import Header from "./components/Header";

function App() {
  return (
    <div>
      <Header text="Report an issue" />
      <div className="ButtonContainer">
        <Button issue="Litter" />
        <Button issue="Potholes" />
        <Button issue="Green spaces" />
        <Button issue="Other" />
      </div>

    </div>
  );
}

export default App;
